import { styled } from '@mui/system'
import { Box,Button,InputAdornment,Paper, Stack,TextField,Typography} from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme'; //**** Special import*/
import {ThemeProvider} from '@mui/material';
import img1 from '/media/nipuna/SSD FILES/FinalProject/FrontEnd/medi-ward-sri-lanka/src/Assest/mainlogo.png'



const theme=Theme();

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:theme.shape.borderRadius*6
  }));

const UserTitleBox=styled(Stack)(({theme})=>({
    marginTop:"100px",
    marginBottom:"70px",
    width:500,
    //backgroundColor:"red",
    //paddingLeft:"100px",
    //paddingRight:"100px",
    textAlign:"center",

}))

const UserText=styled(Stack)(({theme})=>({
    //marginTop:"7px",
    //marginBottom:"7px",
    //backgroundColor:"blue",
    //marginRight:"3px",
    //marginLeft:"3px",
    textAlign:"left",
    width:500,
}))

const UserInputBox=styled(Stack)(({theme})=>({

    //marginTop:"7px",
    //marginBottom:"7px",
    //backgroundColor:"yellow",
    //marginRight:"3px",
    //marginLeft:"3px",
    textAlign:"left",
    width:500,
}))



const Login = () => {

  return (
    <ThemeProvider theme={theme}>
        <Stack bgcolor="white" display="flex" direction="row" justifyContent="center"  alignItems="center" sx={{
            marginTop:6,
            marginBottom:6,
        }}>
            <DemoPaper elevation={6}>
                <Stack display="flex" direction="row" justifyContent="space-between">
                    <Box flex="40%" sx={{
                        display:"flex",
                        justifyContent:"center",
                        alignItems:"center",
                        backgroundColor:theme.palette.primary.main,
                        height:800,
                        borderTopLeftRadius:theme.shape.borderRadius*6,
                        borderBottomLeftRadius:theme.shape.borderRadius*6
                        }}

                    >
                        <img src={img1} alt='Main_Logo' width="350px" height="380px"></img>

                    </Box>

                    <Box flex="55%" sx={{ 
                        height:800,
                        borderTopRightRadius:theme.shape.borderRadius*6,
                        borderBottomRightRadius:theme.shape.borderRadius*6,
                        backgroundColor:theme.palette.background.paper

                        }}
                    >   
                        <Stack display="flex" direction="column" alignItems="center"
                        >
                            <UserTitleBox>
                                <Typography variant="h3">Welcome!</Typography>
                            </UserTitleBox>

                            <Stack display="flex" direction="column" spacing={2}>
                                <UserText>
                                    <Typography variant='h6'>Username</Typography>
                                </UserText>

                                <UserInputBox>

                                    <TextField id="outlined-basic" variant="outlined" placeholder="Enter your username" size='small'sx={{
                                        placeholder:"Enter your username",
                                        size:'small',
                                        width:"100%",
                                        "&:hover":{
                                            outlineColor:theme.palette.success.light
                                        }
                                        }}

                                    />
                                </UserInputBox>

                                <UserText>
                                    <Typography variant='h6'>Password</Typography>
                                </UserText>

                                <UserInputBox>

                                    <TextField id="outlined-basic" variant="outlined" placeholder="Enter your username" size='small'sx={{
                                        placeholder:"Enter your username",
                                        size:'small',
                                        width:"100%",
                                        "&:hover":{
                                            outlineColor:theme.palette.success.light
                                        }
                                        }}

                                    />
                                </UserInputBox>

                            </Stack>

                            <Stack display="flex" direction="row" justifyContent="space-between" sx={{
                                    width:500,
                                    marginTop:"40px",
                                    marginBottom:"40px"
                                    }}
                                >
                                    <Box flex="50%" sx={{
                                        textAlign:"left",
                                    }}><Button variant="text" sx={{color:theme.palette.link.main}}>Reset Password</Button></Box>
                                    <Box flex="50%" sx={{
                                        textAlign:"right",  
                                    }}><Button variant="text" sx={{color:theme.palette.link.main}}>Customer Support</Button></Box>
                            </Stack>

                            <Stack>
                                <Button variant='contained'sx={{
                                    marginTop:"40px",
                                    width:500,
                                    height:35,
                                    color:"White",
                                    "&:hover":{
                                        backgroundColor:theme.palette.secondary.main,
                                    }

                                }}>Login</Button>
                            </Stack>





                        </Stack>




                    </Box>
                </Stack>

            </DemoPaper>
        </Stack>
    </ThemeProvider>
  )
}

export default Login
